window.bookSummaryJSON = "<p>After a long and brutal conflict, the war is over. </p> <p>Otto controls all the portals on the continent, and Garenland has made vassals of the other kingdoms. </p> <p>But some people can’t accept defeat. </p> <p>While Otto hunts King Villares in Rolan, Axel chases Prince Uther across Straken. With Markane scheming to help their enemies, the future of the New Garen Empire is far from certain. </p> <p>Even worse, the Wizards Guild is challenging Otto for leadership of the empire’s wizards, and they’ll use any means necessary to win. </p> <p>The war may be over, but the battles are far from won.</p>"; 
